      currentPrice: "395.00",
      orignalPrice: "450.00",
      discount: "12% Off",
    },
    {
      image: "brewstory/src/assets/Images/products/d5.webp",
      calK: "280 Kcal",
      name: "Chestnut Praline Latte",
      currentPrice: "440.50",
      orignalPrice: "520.00",
      discount: "15% Off",
