      discount: "18% Off",
    },
    {
      image: "brewstory/src/assets/Images/products/p4.webp",
      calK: "300 Kcal",
      name: "Maple Pecan Latte",
      currentPrice: "420.50",
      orignalPrice: "500.00",
      discount: "16% Off",
    },
