      calK: "260 Kcal",
      name: "Pumpkin Spice Latte",
      currentPrice: "380.75",
      orignalPrice: "450.00",
      discount: "15% Off",
    },
    {
      image: "brewstory/src/assets/Images/products/p6.webp",
      calK: "260 Kcal",
      name: "pice Latte",
      currentPrice: "480.75",
      orignalPrice: "550.00",
      discount: "15% Off",
    },
  ];


  document.addEventListener("copy", function (e) {
    e.preventDefault();
    e.clipboardData.setData("text/plain", "Drink Coffee! but dont' copy :)");
  });

  return (
    <BrowserRouter>
      <AuthProvider>
        <Navbar />
        <Routes>
          <Route path='/' element={<HomePage />} />
          <Route path='/home' element={<Home />}>
            <Route path='/home/menu-one' element={<MenuOne />} />
            <Route path='/home/menu-two' element={<MenuTwo />} />
            <Route path='/home/menu-three' element={<MenuThree />} />
            <Route path='/home/menu-four' element={<MenuFour />} />
            <Route path='/home/menu-five' element={<MenuFive />} />
          </Route>
          <Route path='/categories' element={<Categories items={products} />} />
          <Route path='/contact' element={<Contact />} />
          <Route path='/account' element={<Account />}>
            <Route path='/account/login' element={<Login />} />
            <Route path='/account/register' element={<Register />} />
          </Route>
        </Routes>
        <Footer />
      </AuthProvider>
    </BrowserRouter>
  );
}

export default App;
